        {
            path: "/admin/dashboard",
            name: "Dashboard",
            icon: DashboardIcon,
        },
        {
            path: "/admin/salesInfo",
            name: "SalesInfo",
        },
    ];

    return(
        <>
        <Box minHeight={"100vh"} bgColor={"black"} textColor={"white"} width={"200px"}>
           <Image src={logo} marginLeft={"10px"} width={"200px"} height={"200px"}></Image>

           <Flex>

           </Flex>
        </Box>
        </>
    )
};

export default Sidebar;
